        <div style={{ display: 'flex', flexDirection: 'row', flexWrap: 'wrap' }}>
            <Nav />
            <div>
                { children }
            </div>
            {/* <footer style={{ textAlign: 'center', padding: '5rem 0 3rem' }}>@2021 madeby JEB</footer> */}
        </div>
    )
};

export default AppLayout;
